export default function SavingsResult(props){
    return(
        <tr>
        <td>YEAR NUMBER {props.year}</td>
        <td>TOTAL SAVINGS END OF YEAR{props.savingsEndOfYear}</td>
        <td>INTEREST GAINED IN YEAR{props.yearlyInterest}</td>
        <td>TOTAL INTEREST GAINED{props.yearlyInterest*props.year}</td>
        <td>TOTAL INVESTED CAPITAL{props.yearlyContribution*props.year}</td>
      </tr>
    )
}
